local Zigi = AdiBags:RegisterFilter("Zigi", 94)
Zigi.uiName = "Zigi"
Zigi.uiDesc = "Proper organization."

function Zigi:FormatName(name, profession)
	local class = select(2, UnitClass("player"))
	local faction = UnitFactionGroup("player")
	local covenant = C_Covenants and C_Covenants.GetActiveCovenantID() or 0

	-- Shortcuts
	if name == "Pieces" then name = "96. {vehicle-hammergold} Pieces#Usable" end
	if name == "Buff" then name = "97. {ParagonReputation_Checkmark} [00ff00]Buff]#Usable" end
	if name == "Learnable" then name = "98. {ParagonReputation_Checkmark} [00ff00]Learnable]#Usable" end
	if name == "Openable" then name = "99. {ParagonReputation_Bag} [00ff00]Openable]#Usable" end
	if name == "Unbound" then name = "98. Unbound#Unbound" end
	if name == "Account Bound" then name = "99. [00ccff]Account Bound]#Unbound" end
	if name == "Junk" then name = "Junk#Junk" end
	if name == "Mythic Keystone" then
		name = "[a335ee]Mythic Keystone]#Mythic Keystone"
		local map = C_MythicPlus.GetOwnedKeystoneChallengeMapID()
		local level = C_MythicPlus.GetOwnedKeystoneLevel()

		if map and level then
			name = "[a335ee]" .. (ChallengeMap[map] or map) .. " (" .. level .. ")]#Mythic Keystone"
		end
	end

	-- Sanctum
	if name == "94. Garrison#Sanctum" then
		-- Faction specific names for the Garrison
		if faction == "Alliance" then name = "94. Lunarfall#Sanctum" end
		if faction == "Horde" then name = "94. Frostwall#Sanctum" end
	elseif name == "93. Order Hall#Sanctum" then
		-- Class specific names for Order Halls
		if class == "DEATHKNIGHT" then name = "93. Acherus: The Ebon Hold#Sanctum"
		elseif class == "DEMONHUNTER" then name = "93. The Fel Hammer#Sanctum"
		elseif class == "DRUID" then name = "93. The Dreamgrove#Sanctum"
		elseif class == "HUNTER" then name = "93. Trueshot Lodge#Sanctum"
		elseif class == "MAGE" then name = "93. Hall of the Guardian#Sanctum"
		elseif class == "MONK" then name = "93. Temple of Five Dawns#Sanctum"
		elseif class == "PALADIN" then name = "93. Sanctum of Light#Sanctum"
		elseif class == "PRIEST" then name = "93. Netherlight Temple#Sanctum"
		elseif class == "ROGUE" then name = "93. Hall of Shadows#Sanctum"
		elseif class == "SHAMAN" then name = "93. Heart of Azeroth#Sanctum"
		elseif class == "WARLOCK" then name = "93. Dreadscar Rift#Sanctum"
		elseif class == "WARRIOR" then name = "93. Skyhold#Sanctum"
		else name = "Junk#Junk" end -- Other classes have no use for these
	elseif name == "9299. War Ship#Sanctum" then
		-- Faction specific names for the BfA War Ship
		if faction == "Alliance" then name = "9299. The Wind's Redemption#Sanctum" end
		if faction == "Horde" then name = "9299. The Banshee's Wail#Sanctum" end
	elseif name == "91. Covenant#Sanctum" then
		-- Covenant Sanctum names
		if covenant == 1 then name = "910499. Elysian Hold#Sanctum" end
		if covenant == 2 then name = "910199. Sinfall#Sanctum" end
		if covenant == 3 then name = "910299. Heart of the Forest#Sanctum" end
		if covenant == 4 then name = "910399. Seat of the Primus#Sanctum" end
	end

	if faction == "Alliance" then
		name = string.gsub(name, "Kul Tiras/Zandalar", "Kul Tiras")
		name = string.gsub(name, "Kul Tiran/Zandalari", "Kul Tiran")
	end
	if faction == "Horde" then
		name = string.gsub(name, "Kul Tiras/Zandalar", "Zandalar")
		name = string.gsub(name, "Kul Tiran/Zandalari", "Zandalari")
	end

	name = string.gsub(name, "{([%d]+)}", "|T%1:18:18|t") -- texture id
	name = string.gsub(name, "{(Interface/)([%w%p]+)}", "|T%1%2:16:16|t") -- texture path
	name = string.gsub(name, "{([%w%p]+)}", CreateAtlasMarkup("%1")) -- atlas
	name = string.gsub(name, "%[(%x%x%x%x%x%x)%]", "|cff%1") -- color
	name = string.gsub(name, "%[", "|cffcc6633") -- subcategory color
	name = string.gsub(name, "%]", "|r") -- close color

	return name
end

function Zigi:GetBindStatus(bag, slot)
	local tooltipData = C_TooltipInfo.GetBagItem(bag, slot)
	TooltipUtil.SurfaceArgs(tooltipData)

	for _, line in ipairs(tooltipData.lines) do
		TooltipUtil.SurfaceArgs(line)
	end

	for i = 2,3 do
		if tooltipData.lines[i] then
			local t = tooltipData.lines[i].leftText
			if t == ITEM_BIND_ON_EQUIP then
				return "equip"
			elseif t == ITEM_BIND_ON_USE then
				return "use"
			elseif t == ITEM_ACCOUNTBOUND or t == ITEM_BIND_TO_BNETACCOUNT or t == ITEM_BNETACCOUNTBOUND then
				return "account"
			elseif t == ITEM_SOULBOUND or t == ITEM_BIND_ON_PICKUP then
				return "bound"
			end
		end
	end

	return "bound"
end

function Zigi:IsRecipeKnown(bag, slot)
	local tooltipData = C_TooltipInfo.GetBagItem(bag, slot)
	TooltipUtil.SurfaceArgs(tooltipData)

	for _, line in ipairs(tooltipData.lines) do
		TooltipUtil.SurfaceArgs(line)
	end

	local lines = #tooltipData.lines or 0

	if lines > 1 then
		-- Only look at the last 5 lines
		local start = 1
		if lines > 5 then
			start = lines - 5
		end

		for i = start, lines do
			if tooltipData.lines[i] then
				local t = tooltipData.lines[i].leftText
				local c = tooltipData.lines[i].leftColor:GenerateHexColor()
				if t == ITEM_SPELL_KNOWN then
					return 1 -- Already known
				elseif t == TOOLTIP_SUPERCEDING_SPELL_NOT_KNOWN then
					return 2 -- Requires Previous Rank
				elseif string.match(t, "Requires [%a%s]+ %([%d]+%)") and c == "ffff2020" then
					return 2 -- Requires %s (%d)
				elseif string.match(t, "Requires [%a%s]+") and c == "ffff2020" then
					return 2 -- Requires %s
				end
			end
		end
	end

	return false
end

