function Zigi:CheckItem(id, bag, slot, bypass)
	local value = ZigiItems[id]
	local bypass = bypass or false

	local character, realm = UnitFullName("player")
	local level = UnitLevel("player") or 1
	local class = select(2, UnitClass("player"))
	local faction = UnitFactionGroup("player")
	local prof1, prof2, archaeology, fishing, cooking = GetProfessions()
	local profession1 = GetProfessionInfo(prof1 or 0)
	local profession2 = GetProfessionInfo(prof2 or 0)

	if not class then return false end

	if value and not bypass then
		local name, conditions, alt = strsplit("|", value)
		name = Zigi:FormatName(name, profession)

		if id == 182744 and GetItemCount(182746) >= 1 then -- Ornate Belt Buckle
			return strsplit("#", Zigi:FormatName("Openable"))
		end

		if conditions then
			local values = { strsplit(",", conditions) }

			-- Check if it's a match
			local match_any = false

			for _, w in ipairs(values) do
				-- Any w match is a success
				local walues = { strsplit("&", w) }
				local match_w = true
				local match = false

				for _, v in ipairs(walues) do
					-- All of v must match
					match = false

					if v == class or v == faction or v == profession1 or v == profession2 then
						match = true
					elseif v == "XP" and level <= 49 then
						match = true -- XP items can only be used until level 49
					elseif string.match(v, "Name:([%a%-]+)") then
						local n = tostring(string.match(v, "Name:([%a%-]+)") or "")
						if n == character or n == (character.."-"..realm) then
							match = true
						end
					elseif string.match(v, "Level:(%d+)") then
						if level >= tonumber(string.match(v, "Level:(%d+)") or 0) then
							match = true
						end
					elseif string.match(v, "Quest:(%d+)") then
						if not C_QuestLog.IsQuestFlaggedCompleted(tonumber(string.match(v, "Quest:(%d+)") or 0)) then
							match = true
						end
					elseif string.match(v, "Item:(%d+):%d+") then
						if (GetItemCount(tonumber(string.match(v, "Item:(%d+):%d+") or 0), true, false, true) >= tonumber(string.match(v, "Item:%d+:(%d+)") or 0)) then
							match = true
						end
					elseif string.match(v, "Item:(%d+)") then
						if (GetItemCount(tonumber(string.match(v, "Item:(%d+)") or 0), true, false, true) >= 1) then
							match = true
						end
					elseif string.match(v, "Spell:(%d+)") then
						if not IsPlayerSpell(tonumber(string.match(v, "Spell:(%d+)") or 0)) then
							match = true
						end
					elseif string.match(v, "Mount:(%d+)") then
						-- MountID: https://wow.tools/dbc/?dbc=mount
						if not (select(11, C_MountJournal.GetMountInfoByID(tonumber(string.match(v, "Mount:(%d+)") or 0))) or false) then
							match = true
						end
					elseif string.match(v, "Toy:(%d+)") then
						if not PlayerHasToy(tonumber(string.match(v, "Toy:(%d+)") or 0)) then
							match = true
						end
					elseif string.match(v, "Recipe:(%a+:%d+:%d+)") then
						local prof, expansion, skill = string.match(v, "Recipe:(%a+):(%d+):(%d+)")
						prof = strlower(prof or "")
						expansion = tonumber(expansion or 0)
						skill = tonumber(skill or 0)

						if not Breadcrumbs then return "Recipe", "Recipe" end
						
						if prof == strlower(profession1 or "") or prof == strlower(profession2 or "") or prof == "cooking" or prof == "fishing" then
							if Breadcrumbs:Validate("skill:" .. prof .. expansion .. ":" .. skill) then
								local known = Zigi:IsRecipeKnown(bag, slot)
								if not known then
									match = true
								elseif known == 2 then
									return "Recipe", "Recipe"
								end
							else
								return "Recipe", "Recipe"
							end
						end
					end

					if (tonumber(v) or 0) > 0 then -- Minimum item level
						match = true
						local link = C_Container.GetContainerItemLink(bag, slot)
						local itemLevel = GetDetailedItemLevelInfo(link) or 1
						if itemLevel < (tonumber(v) or 0) then
							match = false
						end
					end

					if not match then match_w = false end
				end

				if match_w then match_any = true end
			end

			-- It was a match
			if match_any then
				return strsplit("#", name)
			end

			-- It wasn't a match
			if alt then
				-- Alternative category?
				if alt == "?" then
					return Zigi:CheckItem(id, bag, slot, true)
				else
					alt = Zigi:FormatName(alt, profession)
					return strsplit("#", alt)
				end
			else
				-- Otherwise classify as Junk
				return "Junk", "Junk"
			end
		else
			return strsplit("#", name)
		end
	else
		local link = C_Container.GetContainerItemLink(bag, slot)
		if not link then return false end
		local itemName, _, quality, _, itemMinLevel, itemType, itemSubType, itemStackCount, itemEquipLoc, itemTexture, sellPrice, classID, subclassID, bindType = GetItemInfo(link)
		local bind = Zigi:GetBindStatus(bag, slot)

		if quality == nil or type(quality) ~= "number" then
			return false -- Invalid data
		elseif classID == 4 or classID == 2 or itemEquipLoc == "INVTYPE_PROFESSION_TOOL" or itemEquipLoc == "INVTYPE_PROFESSION_GEAR" then -- Armor, Weapon or Profession Equipment
			if bind == "equip" or bind == "use" then
				return "98. Unbound", "Unbound"
			elseif bind == "account" then
				return "99. |cff00ccffAccount Bound|r", "Unbound"
			elseif itemEquipLoc == "INVTYPE_PROFESSION_TOOL" or itemEquipLoc == "INVTYPE_PROFESSION_GEAR" then
				return "Profession Equipment", "Equipment"
			elseif itemEquipLoc == "INVTYPE_TABARD" then
				return "Tabard", "Equipment"
			elseif itemEquipLoc == "INVTYPE_BODY" then
				return "Shirt", "Equipment"
			elseif quality == 0 or quality == 1 then
				return "Junk", "Junk" -- Soulbind grey or white
			elseif classID == 4 and subclassID == 5 then -- Cosmetic
				return "|cffff80ffCosmetic|r", "Container"
			elseif classID == 4 then -- Armor
				if ClassArmor[class][subclassID] or subclassID == 0 or itemEquipLoc == "INVTYPE_CLOAK" then -- 0 = Jewellry
					return false -- Correct armor type
				elseif profession1 == "Enchanting" or profession2 == "Enchanting" then
					return "0. Obsolete Equipment", "Junk"
				else
					return "Junk", "Junk"
				end
			elseif classID == 2 and not (subclassID == 14 or subclassID == 20) then -- Weapon: 14 = Generic, 20 = Fishing Poles
				if ClassWeapons[class][subclassID] or itemEquipLoc == "INVTYPE_HOLDABLE" then
					return false -- Correct weapon type
				elseif profession1 == "Enchanting" or profession2 == "Enchanting" then
					return "0. Obsolete Equipment", "Junk"
				else
					return "Junk", "Junk"
				end
			end
		elseif quality == 0 and not (classID == 4 or classID == 2) then
			return "Junk", "Junk" -- Poor quality
		end
	end

	return false
end

function Zigi:Filter(slotData)
	local bag, slot = slotData.bag, slotData.slot
	local id = C_Container.GetContainerItemID(bag, slot)

	if id and bag and slot then
		if Zigi:CheckItem(id, bag, slot) then
			return Zigi:CheckItem(id, bag, slot)
		end
	end
	return
end


local OldEquipment = AdiBags:RegisterFilter("0. Obsolete Equipment", 65)
OldEquipment.uiName = "0. Obsolete Equipment"
OldEquipment.uiDesc = "Separates low item level Armor and Weapons for high level characters."

function OldEquipment:CheckItem(id, bag, slot)
	local itemclass = select(12, GetItemInfo(id or 0)) or -1
	local subclass = select(13, GetItemInfo(id or 0)) or -1
	-- https://wowpedia.fandom.com/wiki/ItemType
	-- 4 is Armor, 2 is Weapon

	if ItemLevelThreshold[UnitLevel("player") or 0] then
		if itemclass == 4 or itemclass == 2 then
			local link = C_Container.GetContainerItemLink(bag, slot)
			local itemLevel = GetDetailedItemLevelInfo(link) or 1

			if itemLevel < ItemLevelThreshold[UnitLevel("player") or 0] then
				return "0. Obsolete Equipment", "Junk"
			end
		end
	end

	return false
end

function OldEquipment:Filter(slotData)
	local bag, slot = slotData.bag, slotData.slot
	local id = C_Container.GetContainerItemID(bag, slot)

	if OldEquipment:CheckItem(id, bag, slot) then
		return OldEquipment:CheckItem(id, bag, slot)
	end

	return
end